            let arr = this.props.users
            this.setState({
                users:arr
            })
        }else{

        }
    }


    cardRenderer = () => {
        if(this.props.users.length > 1){
        return this.props.users.map(user => <View>{user.username}</View>)
        }
    }

    render() {
        console.log("home",this.cardRenderer())
